import {React, useEffect, useState} from "react";
import "../Styles/StepsPerLevel.css";

const StepsPerLevel = (props) => {
    useEffect(() => {
        update();
    }, [props.firstLevel, props.secondLevel, props.thirdLevel, props.fourthLevel])

    const update = () => {
        first = props.firstLevel;
        second = props.secondLevel;
        third = props.thirdLevel;
        fourth = props.fourthLevel;
        setFirst(first);
        setSecond(second);
        setThird(third);
        setFourth(fourth);
    }

    let [first, setFirst] = useState(props.firstLevel);
    let [second, setSecond] = useState(props.secondLevel);
    let [third, setThird] = useState(props.thirdLevel);
    let [fourth, setFourth] = useState(props.fourthLevel);


    return(
        <div className="levelStepDisplay">
            <div className="levelStepTitle">STEPS PER LEVEL</div>
            <div className="levelNumWrapper">
                <div>
                    <div className="levelNum"> Level: 1</div>
                    <div className="stepNum"> Steps: {first}</div>
                </div>
                <div>
                    <div className="levelNum"> Level: 2</div>
                    <div className="stepNum"> Steps: {second}</div>
                </div>
                <div>
                    <div className="levelNum"> Level: 3</div>
                    <div className="stepNum"> Steps: {third}</div>
                </div>
                <div>
                    <div className="levelNum"> Level: 4</div>
                    <div className="stepNum"> Steps: {fourth}</div>
                </div>
            </div>
        </div>
    ); 
}

export default StepsPerLevel;
